// Footer.js
import React from 'react';

const Footer = () => {
  // Get current year
  const currentYear = new Date().getFullYear();

  return (
    <p className="text-center text-white fixed bottom-0 w-full py-4 bg-gray-800">&copy; {currentYear} Your Website. All rights reserved.</p>
  );
};

export default Footer;
